import React from "react";
import "./home.css";
import { Link } from "react-router-dom";

import printer from "./assets/print-24px.png";
import APULogo from "./assets/APULogo.png";

const text = {
  color: "#000"
};

export class home extends React.Component {
  render() {
    return (
      <div>
        <Link to="/WEPASupport" style={text}>
          <div className="split left">
            <div className="centered">
              <h1>Printer Support</h1>
              <p>
                If you need help with using the WEPA printers or believe there
                is a problem, please select this side.
              </p>
            </div>
          </div>
        </Link>

        <Link to="/APUSupport" style={text}>
          <div className="split right">
            <div className="centered">
              <h1>Computer Support</h1>
              <p>
                If you need help with any of the lab computers or you are having
                difficulties loggin in, please select this side.
              </p>
            </div>
          </div>
        </Link>
      </div>
    );
  }
}

export default home;
